ObjC.import('stdlib')

var app = Application.currentApplication()
app.includeStandardAdditions = true

var alertText = "Notes"
var alertMessage = $.getenv("notes")
var response = app.displayAlert(alertText, {
    as: "warning",
    buttons: ["Go back", "Close"],
    defaultButton: "Close",
    cancelButton: "Go back",
    message: alertMessage
})
